<template>
    <div class="map-wrapper">
        <button @click="useMapCenter" class="bg:blue color:white" :class="{ active: showUseCenterButton }">Use Map Location</button>
        <div :id="mapId" class="google-map"></div>
    </div>
</template>

<script>
export default {
    props: {
        beacons: {
            type: Array,
        },
        mapId: {
            type: String,
        },
        location: {
            type: Object,
        }
    },
    data() {
        return {
            map: undefined,
            bounds: new google.maps.LatLngBounds(),
            showUseCenterButton: false,
        }
    },
    watch: {
        location(newVal, oldVal) {
            if (newVal === oldVal) {
                return;
            }

            if (!newVal) {
                this.resetMap();
                return;
            }

            this.map.panTo(new google.maps.LatLng(this.location.latitude, this.location.longitude));
            this.map.setZoom(10);
        },
        beacons(newVal, oldVal) {
            if (newVal === oldVal) {
                return;
            }

            this.addBeacons(newVal);
        }
    },
    mounted() {
        this.map = new google.maps.Map(document.getElementById(this.mapId), this.getOptions());
        this.setupMapListener();
    },
    updated() {
        this.addBeacons(this.beacons);
    },
    methods: {
        getMapStyles() {
            switch(this.type) {
                default:
                    return [
                        {
                            "featureType": "landscape.man_made",
                            "elementType": "geometry",
                            "stylers": [
                                {
                                    "color": "#f7f1df"
                                }
                            ]
                        },
                        {
                            "featureType": "landscape.natural",
                            "elementType": "geometry",
                            "stylers": [
                                {
                                    "color": "#d0e3b4"
                                }
                            ]
                        },
                        {
                            "featureType": "landscape.natural.terrain",
                            "elementType": "geometry",
                            "stylers": [
                                {
                                    "visibility": "off"
                                }
                            ]
                        },
                        {
                            "featureType": "poi",
                            "elementType": "labels",
                            "stylers": [
                                {
                                    "visibility": "off"
                                }
                            ]
                        },
                        {
                            "featureType": "poi.business",
                            "elementType": "all",
                            "stylers": [
                                {
                                    "visibility": "off"
                                }
                            ]
                        },
                        {
                            "featureType": "poi.medical",
                            "elementType": "geometry",
                            "stylers": [
                                {
                                    "color": "#fbd3da"
                                }
                            ]
                        },
                        {
                            "featureType": "poi.park",
                            "elementType": "geometry",
                            "stylers": [
                                {
                                    "color": "#bde6ab"
                                }
                            ]
                        },
                        {
                            "featureType": "road",
                            "elementType": "geometry.stroke",
                            "stylers": [
                                {
                                    "visibility": "off"
                                }
                            ]
                        },
                        {
                            "featureType": "road",
                            "elementType": "labels",
                            "stylers": [
                                {
                                    "visibility": "off"
                                }
                            ]
                        },
                        {
                            "featureType": "road.highway",
                            "elementType": "geometry.fill",
                            "stylers": [
                                {
                                    "color": "#ffe15f"
                                }
                            ]
                        },
                        {
                            "featureType": "road.highway",
                            "elementType": "geometry.stroke",
                            "stylers": [
                                {
                                    "color": "#efd151"
                                }
                            ]
                        },
                        {
                            "featureType": "road.arterial",
                            "elementType": "geometry.fill",
                            "stylers": [
                                {
                                    "color": "#ffffff"
                                }
                            ]
                        },
                        {
                            "featureType": "road.local",
                            "elementType": "geometry.fill",
                            "stylers": [
                                {
                                    "color": "black"
                                }
                            ]
                        },
                        {
                            "featureType": "transit.station.airport",
                            "elementType": "geometry.fill",
                            "stylers": [
                                {
                                    "color": "#cfb2db"
                                }
                            ]
                        },
                        {
                            "featureType": "water",
                            "elementType": "geometry",
                            "stylers": [
                                {
                                    "color": "#a2daf2"
                                }
                            ]
                        }
                    ];
            }
        },
        setupMapListener() {
            this.map.addListener('zoom_changed', (event) => {
                if (this.map.getZoom() >= 10) {
                    this.showUseCenterButton = true;
                    return;
                }

                this.showUseCenterButton = false;
            });
        },
        getOptions() {
            switch(this.type) {
                default:
                return {
                    zoom: 5,
                    center: new google.maps.LatLng(this.location.latitude, this.location.longitude),
                    disableDefaultUI: true,
                    zoomControl: false,
                    scaleControle: false,
                    styles: this.getMapStyles(),
                    gestureHandling: 'cooperative'
                }
            }
        },
        expandBounds(latLng) {
            this.bounds.extend(latLng);
        },
        addBeacons(beacons) {
            if (!this.beacons.length) {
                return;
            }

            this.beacons.forEach((beacon, i) => {
                const report = beacon.weatherReports[0];
                const icon = report.conditions == 'Apocalypse' ? `data:image/png;base64,` :
                'data:image/svg+xml;base64,';

                if (report.temperature > 50 && report.windGust < 50 && report.windSpeed < 50) {
                    new google.maps.Marker({
                        position: new google.maps.LatLng(beacon.latitude, beacon.longitude * -1),
                        visible: true,
                        animation: google.maps.Animation.DROP,
                        map: this.map,
                        icon: icon,

                    });
                }
            });
        },
        resetMap() {
            this.map.panTo(new google.maps.LatLng(39.125212, -94.551136));
            this.map.setZoom(5);
        },
        useMapCenter(event) {
            console.log(this.map.getZoom());
        }
    }
}
</script>

<style scoped>
    .map-wrapper {
        position:relative;
    }
    .map-wrapper,
    .google-map {
        width: 100%;
        height: 60vw;
    }
    .google-map {
        display: inline-block;
    }
    .gm-style-cc,
    .gmnoprint {
        display: none !important;
    }
    button {
        opacity: 0;
        border: 0;
        outline: 0;
        padding: 18px 14px;
        border-radius: 5px;
        transition: opacity 0.3s;
        position: absolute;
        top: 24px;
        left: 24px;
    }
    button.active {
        opacity: 0.9;
        z-index: 2;
    }
</style>

